function check_type()
{
	change = false;
	type = value('fuelcell_type');

	if ( type < 3){
		change = yesno('Change defaults for this fuel cell type?');
	}

	if (change)
	{
		// MCFC
		if (type == 0){
			MCFC();
		}
		// PAFC
		else if (type == 1){
			PAFC();
		}
		// SOFC
		else if (type == 2){
			SOFC();
		}
	}
}
on_change{'fuelcell_type'} = define(){
	check_type();
};
